var map = L.map('map').setView([-7.976966412422513, 112.63207633190689], 12);

L.geoJson(kel_malang).addTo(map);

function getColor(d) {
  return d > 30 ? '#800026' :
        d > 25  ? '#BD0026' :
        d > 20  ? '#E31A1C' :
        d > 18  ? '#FC4E2A' :
        d > 15   ? '#FD8D3C' :
        d > 12   ? '#FEB24C' :
        d > 10   ? '#FED976' :
                    '#FFEDA0';
}

function style(feature) {
  return {
      fillColor: getColor(feature.properties.density),
      weight: 2,
      opacity: 1,
      color: 'white',
      dashArray: '3',
      fillOpacity: 0.7
    };
}

L.geoJson(kel_malang, {style: style}).addTo(map);


//Menambahkan Interaksi
function highlightFeature(e) {
  var layer = e.target;

  layer.setStyle({
      weight: 5,
      color: '#666',
      dashArray: '',
      fillOpacity: 0.7
  });

  layer.bringToFront();
  info.update(layer.feature.properties);
}

function resetHighlight(e) {
  geojson.resetStyle(e.target);
  info.update();
}

function zoomToFeature(e) {

}

function onEachFeature(feature, layer) {

      mouseover: highlightFeature,
      mouseout: resetHighlight,
      click: zoomToFeature
  });
}

geojson = L.geoJson(kel_malang, {

}).addTo(map);


//Kontrol Info Kustom

};

info.addTo(map);


//Kontrol Legenda Kustom

legend.onAdd = function (map) {

    return div;
};

legend.addTo(map);
